import { useState, useRef } from "react";
import Lottie from "lottie-react";
import { motion } from "framer-motion";
import t1 from "./t1.json";
import t2 from "./t2.json";
import i1 from "./img1.jpg";
import i2 from "./img2.jpg";
import i3 from "./img3.jpg";
import i4 from "./img4.jpg";
import i5 from "./img4.jpg";

const SequentialLottie = ({ onComplete }) => {
    const [showSecond, setShowSecond] = useState(false);
    const [isSecondStarted, setIsSecondStarted] = useState(false); // 두 번째 애니메이션이 한 번이라도 실행됐는지 여부
    const firstLottieRef = useRef(null);

    return (
        <div className="flex flex-col items-center">
            {/* 첫 번째 애니메이션 */}
            <Lottie
                lottieRef={firstLottieRef}
                animationData={t1}
                loop={false}
                onComplete={() => setShowSecond(true)} // 첫 번째 애니메이션이 끝나면 두 번째 애니메이션 실행
            />

            {/* 두 번째 애니메이션: 첫 번째가 끝난 후 실행됨 (무한 루프) */}
            {showSecond && (
                <Lottie
                    animationData={t2}
                    loop={true} // ❗ 무한 반복
                    onLoopComplete={() => setIsSecondStarted(true)} // 첫 루프가 끝나면 motion.div 표시
                />
            )}

            {/* 두 번째 애니메이션이 한 번이라도 실행되면 motion.div 표시 */}
            {isSecondStarted && (
                <motion.div
                    initial={{opacity: 0, x: 50}}
                    animate={{opacity: 1, x: 0}}
                    transition={{
                        ease: "easeInOut",
                        duration: 2,
                        x: {duration: 1},
                    }}
                    className="flex flex-col items-center w-full px-6 text-center" // ✅ 여백 추가
                >
                    <h3 className="my-4 text-lg font-semibold">To.세상에서 가장 소중한 가은이에게</h3>

                    <p className="mb-2">자기야! 생일 정말 정말 축하해! 🥳🎂🎉</p>
                    <p className="mb-2">벌써 내가 자기 생일을 3번이나 챙겨줬네~! 시간이 너무 빨라?!</p>
                    <p className="mb-2">특히 이번에는 선물 고르는게 너무 어려웠어,,,, 그래서 고민하고 고민하다가 자기가 팔찌가 없는거 같아서 한번 골라봤습니당..!</p>

                    <p className="mb-2">자기 처음 만났을때는 머리가 엄청 짧고 노랬는데</p>
                    <img src={i1} alt="1" className="w-1/2 h-auto my-4 mx-auto"/>

                    <p className="mb-2">지금은 이렇게 길렀네??</p>
                    <img src={i4} alt="1" className="w-1/2 h-auto my-4 mx-auto"/>

                    <p className="mb-2">속초도 놀러가구</p>
                    <img src={i2} alt="1" className="w-1/2 h-auto my-4 mx-auto"/>

                    <p className="mb-2">코타키나발루도 놀러가구</p>
                    <img src={i3} alt="1" className="w-1/2 h-auto my-4 mx-auto"/>

                    <p className="mb-2">제천도 놀러가구</p>
                    <img src={i5} alt="1" className="w-1/2 h-auto my-4 mx-auto"/>

                    <p className="mb-4">여기저기 많이 다녔어!</p>
                    <p className="mb-4">
                        생각해보면 지금까지 내가 행복했던 순간의 대부분은 자기랑 같이 보내왔던거 같아! 그래서 너무 너무 좋아!
                        그리고 내가 힘들때도 자기가 항상 가장 먼저 위로해줘서 너무 너무 고마웠어!
                    </p>

                    <p className="mb-4">
                        앞으로도 자기한테 더 많이 사랑을 주고, 더 많이 행복하게 해주고 싶어! 내가 가끔 서운하게 할때도 있긴하지만,,,,,, 내가 의도를 가지고 그런거는 절대 아니니깐,,,
                        자기가 너그러운 마음으로 조금만 참아줘ㅠㅠ 그래도 빈도수를 줄이려고 항상 노력은 하고 있어!
                    </p>

                    <p className="mb-4">오늘은 자기가 주인공이니깐 자기 하고 싶은거 다해!!</p>
                    <p className="mb-4">자기야 태어나줘서 너무 너무 고맙고 나는 자기를 평생 사랑할거라는걸 항상 기억해줘!!</p>
                    <p className="mb-6 text-xl font-semibold">내가 너무 너무 사랑하고 오늘 생일 너무 축하해💕💕</p>

                    <h3 className="mt-6 text-lg font-semibold">From. 가은이를 세상에서 제일 제일 사랑하는 구승이..</h3>
                </motion.div>

            )}
        </div>
    );
};

export default SequentialLottie;
